document.addEventListener("DOMContentLoaded",function(){const disclosureContainers=document.querySelectorAll(".disclosure-container");disclosureContainers.forEach(container=>{container.setAttribute("aria-hidden","true")});const buttons=document.querySelectorAll(".disclosure-trigger");buttons.forEach(button=>{button.addEventListener("click",function(){let container=button.nextElementSibling;if(container===null){parent=button.parentElement;container=parent.nextElementSibling}const isExpanded=this.getAttribute("aria-expanded")==="true";this.setAttribute("aria-expanded",!isExpanded);if(!isExpanded){container.removeAttribute("aria-hidden")}else{container.setAttribute("aria-hidden","true")}})});const tableRows=document.querySelectorAll("tbody tr");const data=[];const dates=[];tableRows.forEach((row,rowIndex)=>{const rowData=[];const dateCell=row.querySelector("th");if(dateCell){dates.push(dateCell.textContent)}row.querySelectorAll("td").forEach((cell,cellIndex)=>{rowData.push(parseInt(cell.textContent))});data.push(rowData)});const headerRow=document.querySelector("thead tr");const seriesNames=[];headerRow.querySelectorAll("th").forEach((cell,index)=>{if(index!==0){seriesNames.push(cell.textContent)}});Highcharts.chart("container",{chart:{type:"line"},title:{text:null},xAxis:{categories:dates},yAxis:{title:{text:document.getElementById("container").getAttribute("data-yAxisTitle")}},series:seriesNames.map((name,index)=>({name:name,data:data.map(row=>row[index])}))})});